class TestTask1TupleMax:
    def test_maximums_have_function(self, student_code):
        assert callable(student_code.maximums)


    def test_maximums_can_call_function(self, student_code):
        maximums = student_code.maximums

        maximums([(1,2,3),(4,5,6)])
        maximums([(4.1, -3, 6), (-6, 2.0001, 10), (9/5, -5, 8/9), (-2, -7, 2, 7, 8, 2)])
        maximums([(1.1,1.2,-1.3)])
        maximums([(0,)])

    def test_maximums_given_cases(self, student_code):
        maximums = student_code.maximums

        assert maximums([(1,2,3),(4,5,6)]) == [3, 6]
        assert maximums([(4.1, -3, 6), (-6, 2.0001, 10), (9/5, -5, 8/9), (-2, -7, 2, 7, 8, 2)]) == [6, 10, 1.8, 8]
        assert maximums([(1.1,1.2,-1.3)]) == [1.2]
        assert maximums([(0,)]) == [0] # it's not a tuple without the comma


    def test_avg_of_max_have_function(self, student_code):
        assert callable(student_code.avg_of_maximums)


    def test_avg_of_max_can_call_function(self, student_code):
        avg_of_maximums = student_code.avg_of_maximums

        avg_of_maximums([(1,2,3),(4,5,6)])
        avg_of_maximums([(4.1, -3, 6), (-6, 2.0001, 10), (9/5, -5, 8/9), (-2, -7, 2, 7, 8, 2)])
        avg_of_maximums([(1.1,1.2,-1.3)])
        avg_of_maximums([(0,)])


    def test_avg_of_max_given_cases(self, student_code):
        avg_of_maximums = student_code.avg_of_maximums

        assert avg_of_maximums([(1, 2, 3), (4, 5, 6)]) == 4.5
        assert avg_of_maximums([(4.1, -3, 6), (-6, 2.0001, 10), (1.8, -5, 0.8888888888888888), (-2, -7, 2, 7, 8, 2)]) == 6.45
        assert avg_of_maximums([(1.1, 1.2, -1.3)]) == 1.2
        assert avg_of_maximums([(0,)]) == 0.0







